-- Database reset script for conferencia-buenos-aires
-- This script is executed every 5 minutes by a Kubernetes CronJob

SET FOREIGN_KEY_CHECKS = 0;
DROP TABLE IF EXISTS usuarios;
DROP TABLE IF EXISTS tipo_usuario;
SET FOREIGN_KEY_CHECKS = 1;

SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

CREATE TABLE tipo_usuario (
  Id tinyint(4) NOT NULL,
  Nombre varchar(30) NOT NULL,
  PRIMARY KEY (Id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


CREATE TABLE usuarios (
  Id int(11) NOT NULL AUTO_INCREMENT,
  Nombre varchar(30) NOT NULL,
  Apellido varchar(30) NOT NULL,
  Correo varchar(255) NOT NULL,
  Clave varchar(60) NOT NULL,
  Estado enum('Inactivo','Activo','Baneado') NOT NULL,
  FechaCreacion datetime DEFAULT CURRENT_TIMESTAMP,
  Avatar varchar(1024) NOT NULL,
  IdTipoUsuario tinyint(4) NOT NULL,
  PRIMARY KEY (Id),
  KEY IdTipoUsuario (IdTipoUsuario),
  CONSTRAINT usuarios_ibfk_1 FOREIGN KEY (IdTipoUsuario) REFERENCES tipo_usuario (Id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


ALTER TABLE usuarios MODIFY Id int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=104;
COMMIT;
